import styled from "styled-components";
import img from './img.jpeg';
const Profilebox= styled.div`
        position:fixed;
        width:800px;
        height:500px;
        bottom:40%;
        left:50%;
        transform:translateX(-50%);
        border:1px solid black;
        border-radius:4em;
        li{
            margin:10px 0px;
        }


`;


class Profile extends React.Component{
    render(){
        return <div>

                <Profilebox>
                <h2 style={{textAlign:"center"}}>Portfolio</h2>
                    <img style={{width:"300px",border:"1px solid black",borderRadius:"8em",display:"block",margin:"20px"}} src={img}></img>
                     <ul style={{listStyle:"none",float:"right"}}>
                         <hr></hr>
                        <li>
                            <strong>Language</strong>: Spring, React, Java, HTML, CSS, Django, JSP
                        </li>
                        <li>
                            <strong>Name</strong>: 김범수  
                        </li>
                        <li>
                            <strong>Email</strong>:qjatn50089@gmail.com    
                        </li>
                        <li>
                            <strong>Phone</strong>:010-2784-0955
                        </li>
                        <li>
                            <strong>School</strong>:Hallym University
                        </li>
                     </ul>
                </Profilebox>
               </div>
    }
}

export default Profile;
